snippet.textDisplay:
@crimatou364 fique tranquila e segue sua vida, mas rir dos outros cuidado porque isto é falta de sensibilidade para com o próximo. Se vc não perdeu nenhum parente ou amigo dê graças a Deus e até porque vc tb está viva e agradeça a Deus. 
Fique tranquilo porque nós que usamos máscaras estamos pensando no coletivo , não igual a vc que infelizmente não tem empatia.  Continue assim,  mas não chore depois da colheita que vc terá no futuro. 
Triste por pessoas assim que não pensam no bem do próximo.

